import Isi from '../komponen/isi';
import  Link  from 'next/link';


class Main extends React.Component{
    constructor (props){
        super(props);
    }
    render(){
        return (
            <Layout>
            <div class="data">
            <section >
                <div id="Bioskop" class="view"><h2>Bioskop</h2> <Link href="/proyek/bioskop"><a><strong>view all :</strong></a></Link></div>
